import React from "react";
import '../Assets/Styles/ProjectsCardComponent.css';

function ProjectsCardComponent(props){
    return(
        <div className="card-container">
            <img src={props.src} alt={props.alt} className="project-img"></img>
            <h1 className="card-title">{props.name}</h1>
            <a href={props.href} target="blank_" className="repo-btn">Repository</a>
        </div>
    );
}

export default ProjectsCardComponent
